  AddDevice( device )
             A1
---------------------------------------------------------------------------

FC0654  lea       $015E(A6),A0      Point to the system device list.
FC0658  bsr       FC1682            Add the device to the list.
FC065C  jsr       -$01AA(A6)        Update the device's vector checksum.
FC0660  rts       


