FC0884  and.w     #$0FFF,2(SP)      Convert it to a format compatible
FC088A  lsr       2(SP)             with the numbering scheme used
FC088E  lsr       2(SP)             elsewhere.
FC0892  bra.s     FC085A            Process the exception normally.

