FC0A1E  move.l    D0,A2             Point to the first tag.
FC0A20  move.l    (A2)+,D0          Read a longword from the current tag.
FC0A22  beq.s     FC0A36            Exit if end of list reached.
FC0A24  bmi.s     FC0A2E            If this is a link, handle it.
