FC0AAA  move.l    (A2)+,A1          Get the address of this entry.
FC0AAC  move.l    (A2)+,D0          Get the size of this entry.
FC0AAE  jsr       -$CC(A6)          AllocAbs()
FC0AB2  tst.l     D0                Successful?
