FC0B56  move.b    $0C(A0),D0            Get the module's node type.
FC0B5A  cmp.b     #3,D0                 If the node type is NT_DEVICE then
FC0B5E  bne.s     FC0B66
FC0B60  jsr       -$01B0(A6)              AddDevice().
