FC0FB6  btst      #7,D0                 Check the TB_LAUNCH bit.
FC0FBA  beq.s     FC0FC6
FC0FBC  move.b    D0,D2                 If it was set, call the task's
FC0FBE  move.l    $46(A3),A5            TC_LAUNCH routine.
