FC2E08  beq.s     FC2E12                If zero, release the semaphore.
FC2E0A  bmi.s     FC2E50                If it went negative, guru city!
FC2E0C  subq.w    #1,$2C(A0)            Otherwise, just decrement the
FC2E10  bra.s     FC2E4E                ss_QueueCount and exit.

