FC2E32  move.l    8(A1),A1              Get pointer to waiting task.
FC2E36  move.l    A1,$28(A0)            Make this task the ss_Owner.
FC2E3A  moveq     #$10,D0
FC2E3C  jsr       -$0144(A6)            Set waiting task's signal #2.
