FC2E9E  move.l    $0114(A6),A2          Get pointer to current task.
FC2EA2  addq.b    #1,$0127(A6)          Forbid()
FC2EA6  move.l    A0,A3
FC2EA8  move.l    0(A3),D2              Point to first semaphore in list.
FC2EAC  move.l    D2,A1
FC2EAE  move.l    (A1),D2               End of list reached?
