FC318A  clr.b     (A3)+                 Put a zero into the buffer.
FC318C  move.b    (A0)+,(A3)+           Copy the given string.
FC318E  bne.s     FC318C
FC3190  st        (A3)+                 Terminate buffer with $FF.
FC3192  rts       

