FC3194  "&", 0F, "Not enough memory. ", 00
FC31AA  "&", 0F, "Software Failure. ", 00
FC31BF  "&", 0F, "Recoverable Alert. ", 00
FC31D5  EA, 0F, "Press left mouse button to continue.", 00
FC31FC  8E, 1E, "Guru Meditation #%08lx.%08lx", 00

